('DP/SC-02/PDM/2020', 'Recrutement d&apost;un consultant pour l&apost;élaboration du manuel de procédures comptables', 'SQC', 'Forfait', '2022-02-25', '20000000', '4 Jours', '7 Jours', '1 Mois', '2 hommes/mois', 'OUI', 'OUI', NULL, 2, 2, '0', '0', '80', 'Français', 'FCFA', '1 Semaines', 'PTS (Proposition Technique Simplifier', '2022-02-25 18:35:00', 5, 'NON', '', 'BNET', 'Fraternité Matin', '2 Jours', '45 Jours', '2022-02-25 19:05:00', '2022-02-28 08:23:27', '2022-02-28 08:25:58', '00:02:30', 'D-BIRD 001', NULL, '2022-02-28 10:30:02', NULL, '2022-02-25 15:18', '2022-02-28 08:25:58', 'KKONAN', 'PDM', 'TEXTE KOUASSI DU 28/02/2022', 'SC-02/PDM/SPM/2020', 2, 'C:\\inetpub\\vhosts\\clearproject.online\\httpdocs\\ClearProject\\ClearDoc_PDM\\DP\\DP_SC-02_PDM_2020\\TDR.docx', 'Valider', 'RapportEvalTech_01032022164919.pdf', 'Valider', '2022-02-23 03:00:00', '', 'Siège PDM', '28/02/2022', '28/02/2022', 'En cours', '25/02/2022', NULL),
('DP/SC-03/PDM/SPM/2020', 'Recrutement de cabinet d&apost;Audit pour la mission d&apost;Audit annuel', 'SFQC', 'Forfait', '2022-03-02', '35000000', '1 Semaines', '1 Semaines', '32 Jours', '10 hommes/mois', 'NON', 'OUI', NULL, 3, 3, '0,8', '0,2', '79', 'Français', 'FCFA', '2 Semaines', 'PTS (Proposition Technique Simplifier)', '2022-03-02 14:00:00', 6, 'NON', '', '', 'Fraternité matin', '1 Jours', '32 Jours', '2022-03-02 14:30:00', '2022-03-02 14:04:53', '2022-03-02 14:07:56', '00:03:02', 'D-BIRD 001', NULL, '2022-03-02 14:38:33', NULL, '2022-03-02 12:01', '2022-03-02 14:07:56', 'KKONAN', 'PDM', 'Les grands défis à relever pour une production durable  du cacao sont connus : (i) le besoin d’une meilleure maitrise de la production nationale pour d’une part éviter qu’une trop forte progression de la production nationale n’ait un impact négatif sur les cours mondiaux et d’autre part le contrôle de la maladie du Swollen shoot pour éviter un déclin rapide de la production nationale ; (ii) une faible productivité des exploitations qui ne permet pas aux producteurs de sortir de la pauvreté et les problèmes sociaux qui en découlent , en particulier le travail des enfants ; et (iii) la mise en œuvre efficace d’une cacao-culture zéro déforestation pour préserver les dernières ressources forestières du pays et lutter contre le changement climatique.  Pour relever ces défis, le gouvernement met en œuvre son Programme 2QC qui a déjà obtenu des résultats significatifs et qu’il entend renforcer considérablement au cours des prochaines années.', 'SC-03/PDM/SPM/2020', 3, 'C:\\inetpub\\vhosts\\clearproject.online\\httpdocs\\ClearProject\\ClearDoc_PDM\\DP\\DP_SC-03_PDM_SPM_2020\\TDR.docx', 'Valider', 'RapportEvalTech_02032022145901.pdf', 'Valider', '2022-03-01 01:00:00', '', 'Au siège du PDM, Cocody Faya', '02/03/2022', '02/03/2022', 'En cours', '02/03/2022', NULL),
('DP/SC-04/PDM/SPM/2020', 'Recrutement d&apost;un Cabinet d&apost;Expertise en Passation des Marchés', 'SFQ', 'Forfait', '2022-03-03', '24000000', '7 Jours', '4 Jours', '6 Mois', '1 Expert/mois', 'NON', 'NON', NULL, 2, 2, '0', '0', '80', 'Français', 'FCFA', '1 Semaines', '', '2022-03-03 11:30:00', 5, 'NON', '', '', 'Notre voix', '1 Jours', '6 Mois', '2022-03-03 12:00:00', '2022-03-03 11:46:32', '2022-03-03 11:50:36', '00:04:03', 'D-BAD 001', NULL, '2022-03-03 12:56:32', NULL, '2022-03-03 10:31', '2022-03-03 11:50:36', 'KKONAN', 'PDM', 'Les grands défis à relever pour une production durable  du cacao sont connus : (i) le besoin d’une meilleure maitrise de la production nationale pour d’une part éviter qu’une trop forte progression de la production nationale n’ait un impact négatif sur les cours mondiaux et d’autre part le contrôle de la maladie du Swollen shoot pour éviter un déclin rapide de la production nationale ; (ii) une faible productivité des exploitations qui ne permet pas aux producteurs de sortir de la pauvreté et les problèmes sociaux qui en découlent , en particulier le travail des enfants ; et (iii) la mise en œuvre efficace d’une cacao-culture zéro déforestation pour préserver les dernières ressources forestières du pays et lutter contre le changement climatique.  Pour relever ces défis, le gouvernement met en œuvre son Programme 2QC qui a déjà obtenu des résultats significatifs et qu’il entend renforcer considérablement au cours des prochaines années.\r\nConception du Projet. La préparation du PDIC s’inscrit dans le cadre de la nouvelle stratégie du Gouvernement de développement durable de la filière cacao (en préparation) et de « l’Initiative Cacao et Forêts » pour assurer un développement durable et « zéro déforestation » du secteur, et cible en particulier l’accélération de la mise en œuvre du programme du Gouvernement « Quantité-Qualité-Croissance » pour la filière Cacao (2QC, 2014-2023).\r\n\r\nConformément aux recommandations de l’atelier de Grand Bassam de mars 2020, les activités du projet seraient basées sur les acquis et leçons du 2QC et l’amélioration du cadre institutionnel de gestion de la filière à la suite de la revue de la mise en œuvre et des impacts de la réforme de 2011 (en cours de finalisation).  \r\nSes actions seront axées sur : \r\n(i)	L’amélioration du cadre institutionnel de la filière et le renforcement des capacités de ses acteurs à assurer la durabilité environnementale et sociale du secteur (et en particulier la lutte contre les pires formes du travail des enfants) ;\r\n\r\n(ii)	Une meilleure inclusion de tous les acteurs de la filière dans la gestion et la gouvernance du secteur avec notamment la meilleure structuration des producteurs en coopératives et l’établissement d’une interprofession qui s’appuierait sur la mise en place d’un collège de producteurs représentatif et légitime ; \r\n\r\n(iii)	Une approche « paysage », au vu de l’ampleur des problèmes et des ressources disponibles et pour obtenir rapidement des résultats visibles, intégrant pleinement la problématique cacao-foret et permettant une coordination étroite entre les interventions du secteur public (institutions gouvernementales, autorités régionales, communautés de base, secteur privé, partenaires au développement) ;\r\n(iv)	Des modalités de mise en œuvre basées sur les institutions nationales, une coopération renforcée entre tous les acteurs et une transparence renforcée dans la gestion de la filière à travers la généralisation de la digitalisation des opérations du CCC, y-compris des fonds qu’il gère au nom des producteurs (FIMR, FIA).\r\n', 'SC-04/PDM/SPM/2020', 4, 'C:\\inetpub\\vhosts\\clearproject.online\\httpdocs\\ClearProject\\ClearDoc_PDM\\DP\\DP_SC-04_PDM_SPM_2020\\TDR.docx', 'Valider', 'RapportEvalTech_20042022153220.pdf', 'Valider', '2022-03-02 10:26:00', '', 'Plateau au siège du PDM', '02/03/2022', '03/03/2022', 'En cours', '03/03/2022', NULL),
('DP/SC-05/PDM/SPM/2020', 'Recrutement de cabinet de Consultant spécialisé en sauvegarde environnementale et sociale', 'SCBD', 'Forfait', '2022-03-04', '45000000', '0 ', '1 Semaines', '1 Mois', '1 hommes/mois', 'NON', 'NON', NULL, 2, 2, '0', '0', '75', 'Français', 'FCFA', '1 Jours', 'PTS (Proposition Technique Simplifier)', '2022-03-04 15:30:00', 6, 'NON', '', 'PM-PROJECTS', 'Fraternité Matin', '1 Jours', '30 Jours', '2022-03-04 16:10:00', '2022-03-04 15:52:19', '2022-03-04 15:54:31', '00:02:11', 'P-BAD 001', NULL, '2022-03-04 16:14:43', NULL, '2022-03-04 15:00', '2022-03-04 15:54:31', 'KKONAN', 'PDM', 'Qui sommes-nous ?\r\nPerformance Management Projects (PM-PROJECTS) est une entreprise spécialisée dans le domaine des projets et programmes de développement. Plus précisément dans la formation, la conception et le développement d’applications spécifiques de gestion.\r\n', 'SC-05/PDM/SPM/2020', 5, 'C:\\inetpub\\vhosts\\clearproject.online\\httpdocs\\ClearProject\\ClearDoc_PDM\\DP\\DP_SC-05_PDM_SPM_2020\\TDR.docx', 'Valider', 'RapportEvalTech_04032022161634.pdf', 'Valider', '2022-03-03 10:00:00', '04/03/2022 15:40:00', 'Siège PDM Plateau', NULL, NULL, 'En cours', '04/03/2022', NULL),
('DP/SC-06/PDM/SPM/2020', 'Recrutement d&apost;un cabinet de Consultant pour le renforcement des capacités de la cellule comptable du Projet', 'SMC', 'Forfait', '2022-03-07', '17000000', '1 Semaines', '1 Semaines', '30 Jours', '1 Expert/mois', 'OUI', 'NON', NULL, 2, 2, '0', '0', '75', 'Français', 'FCFA', '2 Semaines', 'PTS (Proposition Technique Simplifier)', '2022-03-07 12:40:00', 4, 'NON', '', 'PM-PROJECTS', 'Notre Voix', '1 Jours', '30 Jours', '2022-03-07 13:10:00', '2022-03-07 13:39:55', '2022-03-07 13:41:41', '00:01:45', 'P-IDA 001', NULL, '2022-03-07 13:50:56', NULL, '2022-03-07 12:04', '2022-03-07 13:41:41', 'KKONAN', 'PDM', 'L’Accord Juridique régit les relations juridiques entre l’Emprunteur et la Banque. Le Règlement\r\nde Passation des Marchés s’applique à la passation des marchés de Fournitures, de Travaux, de\r\nServices Autres que les Services de Consultants, et de Services de Consultants dans le cadre des\r\nopérations de FPI, tel que prévu dans l’Accord Juridique. Les droits et obligations de l’Emprunteur\r\net des prestataires de Fournitures, de Travaux, de Services Autres que des Services de Consultants\r\net de Services de Consultants pour des opérations de FPI sont régis par le dossier pertinent d’appel\r\nd’offres ou d’appel à propositions et par les contrats signés par l’Emprunteur et les prestataires de\r\nFournitures, de Travaux, de Services Autres que des Services de Consultants et de Services de\r\nConsultants, et non pas par le présent Règlement de Passation des Marchés ou l’Accord Juridique.\r\nAucune partie autre que les parties à l’Accord Juridique ne peut se prévaloir des droits découlant\r\ndes fonds provenant du financement ni prétendre détenir une créance sur lesdits fonds.\r\n2.2 Le Règlement de Passation des Marchés ne s’applique pas à la passation des marchés de Fournitures\r\net de Travaux et des contrats de Services de Consultants et de Services Autres que des Services de\r\nConsultants financés par la Banque :\r\na. dans des projets faisant intervenir des Garanties de la Banque ; et\r\nb. au moyen de prêts accordés à des emprunteurs privés par le biais d’intermédiaires financiers\r\nadmissibles.\r\n2.3 Pour les marchés qui ne sont pas financés par la Banque, mais s’inscrivent dans le cadre d’un projet\r\nfinancé par la Banque, l’Emprunteur peut adopter d’autres règles et procédures de passation des\r\nmarchés s’il est établi à la satisfaction de la Banque que :\r\na. lesdites règles et procédures satisfont aux obligations de l’Emprunteur de réaliser le projet\r\navec diligence et efficacité ; et\r\nb. les Fournitures, Travaux, Services Autres que des Services de Consultants et Services de\r\nConsultants devant faire l’objet de la passation des marchés :', 'SC-06/PDM/SPM/2020', 6, 'C:\\inetpub\\vhosts\\clearproject.online\\httpdocs\\ClearProject\\ClearDoc_PDM\\DP\\DP_SC-06_PDM_SPM_2020\\TDR.docx', 'Valider', 'RapportEvalTech_07032022135537.pdf', 'Valider', '2022-03-06 04:00:00', '', 'Siège de PDM', '07/03/2022', '07/03/2022', 'En cours', '07/03/2022', NULL);
